import React, {Component} from 'react';
import RightArrow from '../img/right-arrow.jpg';
import './ProcessRender.css';

const fermented_process_name = ["Raw Material", "Roasted Beans", "Winnowed Beans", "Ground Beans", "Chocolate Bars"];
const unfermented_process_name = ["Raw Material", "Roasted Beans", "Winnowed Beans", "Ground Beans", "Cocoa Powder"];
const fermented_process_list = fermented_process_name.map((name => (
  <div className="process-name-container">
    <div className="name-text">{name}</div>
    <div className={`process-name ${name}`}></div>
    <div><img src={RightArrow}></img></div>
  </div>
)))
const unfermented_process_list = unfermented_process_name.map((name => (
  <div className="process-name-container">
    <div className="name-text">{name}</div>
    <div className={`process-name ${name}`}></div>
  </div>
)))

class ProcessRender extends Component {
  render() {
    return (
      <div className="process outer-container">
        <div className="page-title">Production Process</div>
        <div className="process-title">Fermented Beans</div>
        <div className="process-container">
          {fermented_process_list}
        </div>
        <div className="process-title">Unfermented Beans</div>
        <div className="process-container">
          {unfermented_process_list}
        </div>

      </div>

    );
  }
}

export default ProcessRender;
